import React from 'react';

function Transfers() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">Transfers</h1>
      <p>Send and receive money.</p>
    </div>
  );
}

export default Transfers;
